import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
// import { Input, Header } from 'react-native-elements';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import HomeScreen from './screens/HomeScreen';
import CadastroUsuarioScreen from './screens/CadastroUsuarioScreen';
import LoginScreen from './screens/LoginScreen';
import ListaDeContatosScreen from './screens/ListaDeContatosScreen';
import CadastroContatoScreen from './screens/CadastroContatoScreen'

const Stack = createNativeStackNavigator();

export default function App() {

  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Login">
        <Stack.Screen name="Home" component={HomeScreen} />
        <Stack.Screen name="cadastroContato" component={CadastroContatoScreen} />
        <Stack.Screen name="listaContato" component={ListaDeContatosScreen} />
        <Stack.Screen name="Login" component={LoginScreen} />
        <Stack.Screen name="Cadastro" component={CadastroUsuarioScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
